Kimmy Dora and the Temple of Kiyeme is a Filipino comedy horror film directed by Joyce Bernal and is a sequel to the Kimmy Dora film in 2009. The film premiered nationwide in the Philippines on June 13, 2012. The movie becomes the 2nd highest grossing Filipino film of 2012 earning 100 Million Pesos in two weeks.
It tells the story of twin sisters Kimmy and Dora, both played by Eugene Domingo in their quest to find love in South Korea.[2]

Plot

Kimmy and Dora (both Eugene Domingo) are identical twins with different personalities. Kimmy is the smart, dictatorial type while Dora is the slow, dumb-wit sister. However, they end up being close to each other and appreciated the love as sisters. The film will focus before the birth of the twins. It was a set-up arranged marriage for their father Don Luisito Go Dong Hae played by Ariel Ureta to a lady with Korean Sang Kang Kang played by Alodia Gosiengfiao. Go Dong Hae refuses to marry and chose Kimmy and Dora's mother as his wife. In the present, an unexpected ghost is surfacing the family's lives and they found out that Sang Kang Kang that is supposed to be married by their father was already dead and they need to quest for the tranquility of their lives by travelling all the way to South Korea.[3] As Kimmy and Dora accepts the proposals of their boyfriends played by Zanjoe Marudo and Dingdong Dantes, strange things began to happen leading their boyfriends and their father in a comatose condition. Sang Kang Kang is back for revenge, and Kimmy and Dora are trying every possible solution to fight against the revenge ghost.

